import re

prots = {
	"albumin": "",
	"thryoglobulin": "",
	"fibronectin": "",
	"alpha2macroglobulin": "",
	"lama4": "",
	"lamb1": "",
}

def get_aa_prop(seq, aa):

	occ = len(list(re.finditer(aa, seq)))
	return occ / len(seq)

for aa in ["K", "R", "D", "E"]:
	print(aa)
	for prot in prots.keys():
		print(f"{prot}: {get_aa_prop(prots[prot], aa)}")
	print("-" * 25)
